<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
      <meta property="og:title" content="Running Man and Sheep" />
  <meta property="og:description" content="RUN!!!! DON'T STEP ON THAT SHEEP!!" />
  <meta property="og:image" content="https://i.ibb.co.com/fNxcC2F/20241102-070302.jpg" />
  <meta property="og:url" content="https://satu-persen.github.io/-/running.html" />
  <meta property="og:type" content="website" />
    <title>By Dika</title>
    <style>
        body {
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
            font-family: Arial, sans-serif;
            background-color: #87CEEB;
            overflow: hidden;
        }
        #gameContainer {
            width: 800px;
            height: 300px;
            border: 2px solid #333;
            position: relative;
            background-color: #f0f0f0;
            overflow: hidden;
        }
        #player {
            width: 40px;
            height: 40px;
            background-image: url('https://www.pngall.com/wp-content/uploads/13/Running-Man-Silhouette-No-Background.png');
            background-size: cover;
            position: absolute;
            bottom: 10px;
            left: 50px;
            transition: bottom 0.2s;
        }
        .obstacle {
           width: 20px;
           height: 20px;
          background-image: url('https://i.ibb.co.com/2PRW0h4/CITYPNG-COM-Wooly-Sheep-Sitting-1000x1000.png');
         background-size: cover;
        position: absolute;
        bottom: 10px;
        animation: moveObstacle 3s linear infinite;
}
        @keyframes moveObstacle {
            from { right: -20px; }
            to { right: 800px; }
        }
        #score {
            position: absolute;
            top: 10px;
            left: 10px;
            font-size: 18px;
            color: #333;
        }
        #jumpButton {
            position: absolute;
            top: 20px;
            right: 20px;
            padding: 10px 20px;
            font-size: 16px;
            background-color: #333;
            color: #fff;
            border: none;
            cursor: pointer;
            border-radius: 5px;
        }
        #jumpButton:hover {
            background-color: #555;
        }
    </style>
</head>
<body>

<div id="gameContainer">
    <div id="player"></div>
    <div id="score">Score: 0</div>
    <button id="jumpButton" onclick="jump()">Jump</button>
</div>

<script>
    const player = document.getElementById('player');
    const scoreDisplay = document.getElementById('score');
    const gameContainer = document.getElementById('gameContainer');
    let score = 0;
    let isJumping = false;
    let isGameOver = false;

    function jump() {
        if (!isJumping) {
            isJumping = true;
            player.style.bottom = '100px';
            setTimeout(() => {
                player.style.bottom = '10px';
                isJumping = false;
            }, 300);
        }
    }

    function createObstacle() {
        if (isGameOver) return;  // Hentikan pembuatan rintangan jika game over

        const obstacle = document.createElement('div');
        obstacle.classList.add('obstacle');
        obstacle.style.right = '0px';
        gameContainer.appendChild(obstacle);

        const moveObstacle = setInterval(() => {
            const playerRect = player.getBoundingClientRect();
            const obstacleRect = obstacle.getBoundingClientRect();

            if (
                playerRect.right > obstacleRect.left &&
                playerRect.left < obstacleRect.right &&
                playerRect.bottom > obstacleRect.top &&
                playerRect.top < obstacleRect.bottom
            ) {
                if (!isGameOver) {
                    isGameOver = true; // Tandai game over hanya sekali
                    alert('Game Over! Skor kamu: ' + score);
                    resetGame();
                }
                clearInterval(moveObstacle);
                obstacle.remove();
            }

            if (obstacleRect.right <= 0) {
                clearInterval(moveObstacle);
                obstacle.remove();
                score++;
                scoreDisplay.innerText = `Score: ${score}`;
                adjustDifficulty();
            }
        }, 20);
    }

    function resetGame() {
        isGameOver = false;
        score = 0;
        scoreDisplay.innerText = `Score: ${score}`;
        const obstacles = document.querySelectorAll('.obstacle');
        obstacles.forEach(obstacle => obstacle.remove());
    }

    function adjustDifficulty() {
        if (score % 10 === 0 && score > 0) {
            for (let i = 0; i < score / 10; i++) {
                setTimeout(createObstacle, i * 300);
            }
        }
    }

    document.addEventListener('keydown', (e) => {
        if (e.code === 'Space') {
            jump();
        }
    });

    setInterval(createObstacle, 1500);
</script>

</body>
</html>
